import React from "react";
import "./cv.scss";

function CvPreview() {
  return (
    <div className="cv-container">
      {/* Simple image preview */}
      <img
        src="/assets/CV_SOLER_2024_Accenture.jpeg"
        alt="CV Preview"
        className="cv-image"
      />
    </div>
  );
}

export default CvPreview;
